// Fungsi untuk memformat popup kabupaten
function formatPopup(properties) {
    return `
        <div class="popup-content max-h-96 overflow-y-auto" style="width: 320px;">
            <h3 class="font-bold text-lg">${properties.Kabupaten}, ${properties.Provinsi}</h3>
            <p><b>Info Dasar:</b><br>
                1. Luas Wilayah: ${properties.Luas_Km2} kmÂ²<br>
                2. Populasi: ${properties.Populasi}<br>
                3. Kecamatan: ${properties.Kecamatan}<br>
                4. Kelurahan: ${properties.Kelurahan}<br>
                5. Desa: ${properties.Desa}<br>
                6. RW: ${properties.RW}
            </p>
            <p><b>Isu Lingkungan(DIKPLHD):</b><br>${properties.Isu_LH.replace(/\n/g, '<br>')}</p>
            <p><b>Laboratorium Lingkungan:</b> ${properties.Lab_Ling}</p>
            <p><b>Perizinan Lingkungan:</b><br>${properties.Perling.replace(/\n/g, '<br>')}</p>
            <p><b>Program Iklim:</b><br>${properties.Proklim.replace(/\n/g, '<br>')}</p>
            <p><b>Timbulan Sampah:</b><br>${properties.Timbulan_S.replace(/\n/g, '<br>')}</p>
            <p><b>Sampah Terkelola:</b><br>${properties.Sampah_Kel.replace(/\n/g, '<br>').replace(/(\d+)\.(\d{4})\(([\d,.]+%)\)/g, '($2) $3')}</p>
            <p><b>Fasilitas Sampah(SIPSN 2021-2024):</b><br>${properties.Fasilitas_.replace(/\n/g, '<br>')}</p>
            <p><b>Komposisi Sampah:</b><br>${properties.Komposisi_.replace(/\n/g, '<br>')}</p>
            <p><b>Sumber Sampah:</b><br>${properties.Sumber_Sam.replace(/\n/g, '<br>')}</p>
            <p><b>Indeks Kualitas LH:</b><br>${properties.IKLH.replace(/\n/g, '<br>')}</p>
            <p><b>Limbah B3:</b><br>${properties.B3.replace(/\n/g, '<br>')}</p>
        </div>
    `;
}

// Fungsi untuk memformat popup fasilitas sampah berdasarkan tipe
function formatFacilityPopup(properties) {
    // Base popup content
    let popupContent = `
        <div class="popup-content max-h-96 overflow-y-auto" style="width: 200px;">
            <h3 class="font-bold text-lg">${properties.Name}</h3>
            <p><b>Tipe:</b> ${properties.Type}<br>
            <b>Sistem Operasional:</b> ${properties.Description}<br>
            <b>Kabupaten:</b> ${properties.Kabupaten}<br>
            <b>Kecamatan:</b> ${properties.Kecamatan}<br>
            <b>Desa:</b> ${properties.Desa}<br>
    `;

    // Tambahkan informasi tambahan berdasarkan tipe fasilitas
    if (properties.Type === 'TPA' || properties.Type === 'BSI') {
        popupContent += `
            <b>Kapasitas (m3/hari):</b> ${properties.Kapasitas !== null ? properties.Kapasitas : 'Unknown'}<br>
            <b>Luas Fasilitas:</b> ${properties.Luas_Total !== null ? properties.Luas_Total + ' ha' : 'Unknown'}<br>
            <b>Luas Unit Pengelolaan Sampah:</b> ${properties.Luas_Unit !== null ? properties.Luas_Unit + ' ha' : 'Unknown'}<br>
            <b>Kapasitas Sampah Masuk (m3/hari):</b> ${properties.Kapasitas1 !== null ? properties.Kapasitas1 : 'Unknown'}<br>
        `;
    } else if (properties.Type === 'TPS3R' || properties.Type === 'BSU') {
        // Untuk TPS3R dan BSU, hanya tampilkan kapasitas jika tersedia
        if (properties.Kapasitas !== null) {
            popupContent += `
                <b>Kapasitas (m3/hari):</b> ${properties.Kapasitas}<br>
            `;
        }
        if (properties.Luas_Total !== null) {
            popupContent += `
                <b>Luas Fasilitas:</b> ${properties.Luas_Total} ha<br>
            `;
        }
        if (properties.Luas_Unit !== null) {
            popupContent += `
                <b>Luas Unit Pengelolaan Sampah:</b> ${properties.Luas_Unit} ha<br>
            `;
        }
        if (properties.Kapasitas1 !== null) {
            popupContent += `
                <b>Kapasitas Sampah Masuk (m3/hari):</b> ${properties.Kapasitas1}<br>
            `;
        }
    }

    // Tutup div
    popupContent += `</div>`;
    return popupContent;
}

